frame_eqs_eel:
warp=0;
state=2.5+sin(time);
wave_r = wave_r + if(equal(state,3),.5*sin(bass),.5*sin(time*.777));
wave_g = wave_g + if(equal(state,2),.5*sin(treb),.5*sin(time*.888));
wave_b = wave_b + .5*sin(time);
Q1 = max(max(bass,bass_att)-1.2,0);
vol = (bass+mid+att)/6;
xamptarg = if(equal(frame%15,0),min(0.5*vol*bass_att,0.5),xamptarg);
xamp = xamp + 0.5*(xamptarg-xamp);
xdir = if(above(abs(xpos),xamp),-sign(xpos),if(below(abs(xspeed),0.1),2*above(xpos,0)-1,xdir));
xaccel = xdir*xamp - xpos - xspeed*0.055*below(abs(xpos),xamp);
xspeed = xspeed + xdir*xamp - xpos - xspeed*0.055*below(abs(xpos),xamp);
xpos = xpos + 0.001*xspeed;
yamptarg = if(equal(frame%15,0),min(0.3*vol*treb_att,0.5),yamptarg);
yamp = yamp + 0.5*(yamptarg-yamp);
ydir = if(above(abs(ypos),yamp),-sign(ypos),if(below(abs(yspeed),0.1),2*above(ypos,0)-1,ydir));
yaccel = ydir*yamp - ypos - yspeed*0.055*below(abs(ypos),yamp);
yspeed = yspeed + ydir*yamp - ypos - yspeed*0.055*below(abs(ypos),yamp);
ypos = ypos + 0.001*yspeed;
mv_x_speed = 16;
mv_y_speed = 12;
mv_x_range = 0.299;
mv_y_range = 0.299;
mv_x_amount = 3;
mv_y_amount = 3;
mv_x = mv_x_amount +mv_x_range + mv_x_range*sin(mv_x_speed*ypos+(sin(time*0.964)-0.5*cos(time*0.256)));
mv_y = mv_y_amount + mv_y_range+ mv_y_range*sin(mv_y_speed*xpos-(cos(time*1.345)-0.5*cos(time*0.331)));
mv_b = mv_b - 0.3*sin(time*5.211);
mv_r = mv_r + 0.25*cos(time*1.91);
mv_g = mv_g + 0.25*cos(time*1.861);
mv_l =  10 + 2*min(bass*0.5 + bass_att*0.5,2);

pixel_eqs_eel:
floon=if(equal(q1,3),-.1,if(equal(q1,2),2,1));
flarn = sin(ang*10+time+abs(pow(rad,q1)*10%5));
zoom = zoom+.07*flarn*floon;
rot = rot+.02*flarn*floon;
